  })))), "December"), mdx("p", null, "Kicked off the month with the long-awaited and deserved vacation, a cruise to Hawaii. This was the longest cruise we have been on! Before we started our cruise, we got upgraded to a balcony room which is more spacious! We spend the first few days at sea with nothing but water surrounding us. The ocean was a bit rough sometimes which made a bunch of people seasick. Even so, there were a lot of fun activities and events on the ship that time flew by."), mdx("p", null, "When we arrived in Hawaii, we stopped at the Big Island in Kona and enjoyed the beaches. We also got to do some fun shopping. We also got to enjoy the Christmas parade and the Christmas lights in the city. The next day we did some tours and shopping around as well as experience the local farmers market."), mdx("p", null, "Then we docked at Honolulu, where we went to the bishop museum and followed it by exploring Ala Moana Mall. After that we enjoyed the Waikiki beach and the touristy areas around it and did some more shopping. The next day was a fun but stressful tour around the island! We got to try a bunch of local foods, see some cool areas and learn more about the island and the people in our Sights and Bites tour. Although the tour was great and fun, our tour bus broke down on the opposite side of the island, so we kind of got stranded away from our ship and we needed to be back before it left! We got lucky and found an Uber who was willing to take us to the other side of the island and we made it back to the ship just in time."), mdx("p", null, "On the way back we ran into a small hiccup, the ship had to turn around and head back towards Honolulu because someone needed medical attention. They did a medical helicopter pickup which required us to evacuate the back of the ship in case the helicopter crashed into us. Because of that we were delayed more than 6 hours which meant we might not make it to our next stop in Ensenada Mexico on time. However, our captain decided to floor it and we made it to Ensenada on time. We got to enjoy the city and do some shopping and eating. I got to enjoy the best fresh authentic churros I have ever had!"), mdx("p", null, "After Ensenada the cruise was over and we headed back to Vegas. However the fun didn't stop! The next day we got to enjoy front row seats to the Silver Knights hockey game. It was a great experience. The next day got to celebrate the graduation of a dear friend and party up some more. Then it was Christmas and New Year's which I celebrated with my family and my sister's inlaws."), mdx("p", null, "The fun didn't end with Christmas! We still had New Year's to celebrate. We didn't celebrate it once but rather twice! We celebrated it with my family and my sister's inlaws first. And on actual New Years Eve we were invited and attended the church party. It was a great party and a great way to end the year!"), mdx(Gallery, {
